definitions:
  Import:
    title: Import
    type: object
    properties:
      id:
        type: integer
        description: Unique identifier representing a specific import
      createdAt:
        type: string
        format: date-time
        description: Import creation datetime
      updatedAt:
        type: string
        format: date-time
        description: Import update datetime
      lastImportAt:
        type: string
        format: date-time
        description: Last import's datetime
      importer:
        type: string
        description: Importer used to import this
      schedule:
        type: string
        description: Cron formatted schedule
      identifier:
        type: string
        description: Identifier used in import
      restaurantId:
        type: integer
        description: Unique identifier representing a restaurant this menu belongs to
